import react from "react";
import reactDom from "react-dom";

// function component
function Hello(){
    const myName = "Nyiizin"
    return <h1>Hello {myName}</h1>;
}

// function component
function Link(){
    return <a href="#">Link to my web site</a>
}
reactDom.render(
<>
<Hello />
<Link />
</>
, document.getElementById("root"));
